import React, { useState } from "react";

const LoginForm = () => {
  const [focus, setFocus] = useState({ username: false, password: false });

  const styles = {
    body: {
      margin: 0,
      padding: 0,
      height: "100%",
      width: "100%",
    },
    background: {
      backgroundImage: "url('lbg.png')", // Replace with your image URL
      backgroundSize: "cover",
      backgroundPosition: "center",
      backgroundAttachment: "fixed",
      height: "100%",
      width: "100%",
    },
    formWrapper: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      height: "100vh",
    },
    formContainer: {
      background: "rgba(255, 255, 255, 0.7)",
      backdropFilter: "blur(0px)",
      WebkitBackdropFilter: "blur(0px)",
      borderRadius: "10px",
      padding: "25px",
      boxShadow: "0 4px 6px rgba(0, 0, 0, 0.1)",
      width: "90%",
      maxWidth: "500px", // Limits width on large screens
    },
    header: {
      display: "flex",
      alignItems: "center",
      justifyContent: "center",
      flexDirection: "row",
      gap: "10px", // Space between logo and text
      marginBottom: "20px",
    },
    logo: {
      height: "60px",
      width: "60px",
    },
    title: {
      fontSize: "70px",
      color: "#363100",
      fontWeight: "800",
      margin: 0, // Remove default margin
    },
    inputWrapper: {
      position: "relative",
      marginBottom: "20px",
    },
    label: (focused) => ({
      position: "absolute",
      left: "10px",
      top: focused ? "-10px" : "50%",
      fontSize: focused ? "12px" : "16px",
      color: "#363100",
      transition: "all 0.3s ease",
      transform: focused ? "translateY(0)" : "translateY(-50%)",
      padding: "0 5px",
    }),
    input: {
      width: "100%",
      padding: "10px",
      border: "1px solid transparent", // No border by default
      borderRadius: "10px",
      outline: "none", // Removes the default browser outline
      backgroundColor: "#f8f8f8", // Optional: A soft background color
      transition: "all 0.3s ease", // Smooth transition for focus styles
    },
    inputFocused: {
      border: "1px solid #ffffff", // Highlight border on focus
      boxShadow: "0 0 8px rgba(193, 184, 87, 0.5)", // Optional glow effect
      backgroundColor: "#fff", // Optional: Brighter background
    },
    button: {
      width: "100%",
      padding: "10px",
      margin: "10px 0",
      border: "1px solid #ccc",
      borderRadius: "10px",
      backgroundColor: "#C1B857",
      color: "#363100",
      cursor: "pointer",
      fontWeight: "700",
    },
    forgotPassword: {
      display: "block",
      textAlign: "center",
      fontSize: "16px",
      color: "#363100",
      marginTop: "10px",
      textDecoration: "none",
      fontWeight: "300",
    },
    socialButtonsContainer: {
      display: "flex",
      justifyContent: "center",
      gap: "30px", // Space between the buttons
      marginTop: "20px",
    },
    socialButtonImg: {
      width: "100%",
      maxWidth: "45px", // Ensure images do not stretch too much
      height: "auto",
      borderRadius: "10px",
      cursor: "pointer",
    },
    signup: {
      justifyContent: "center",
      display: "flex",
      marginTop: "30px",
    },
    signupText: {
      fontSize: "14px",
      fontWeight: "200",
      color: "#363100",
    },
    signupLink: {
      textDecoration: "none",
      fontWeight: "700",
      color: "#363100",
    },
    "@media (max-width: 768px)": {
      header: {
        flexDirection: "column", // Stack logo and text vertically on small screens
      },
      title: {
        fontSize: "50px", // Reduce font size for smaller screens
      },
      logo: {
        height: "50px", // Adjust logo size
        width: "50px",
      },
    },
    "@media (max-width: 480px)": {
      title: {
        fontSize: "40px", // Further reduce font size for very small screens
      },
      logo: {
        height: "40px",
        width: "40px",
      },
    },
  };

  const handleFocus = (field) => setFocus((prev) => ({ ...prev, [field]: true }));
  const handleBlur = (field, value) => {
    if (!value) setFocus((prev) => ({ ...prev, [field]: false }));
  };

  return (
    <div style={styles.background}>
      <div style={styles.formWrapper}>
        <div style={styles.formContainer}>
          <form>
            {/* Header with Logo and Title */}
            <div style={styles.header}>
              <h2 style={styles.title}>CUISINING</h2>
            </div>
            {/* Username Input */}
            <div style={styles.inputWrapper}>
              <label style={styles.label(focus.username)}>Username</label>
              <input
                type="text"
                style={{
                  ...styles.input,
                  ...(focus.username && styles.inputFocused),
                }}
                onFocus={() => handleFocus("username")}
                onBlur={(e) => handleBlur("username", e.target.value)}
              />
            </div>
            {/* Password Input */}
            <div style={styles.inputWrapper}>
              <label style={styles.label(focus.password)}>Password</label>
              <input
                type="password"
                style={{
                  ...styles.input,
                  ...(focus.password && styles.inputFocused),
                }}
                onFocus={() => handleFocus("password")}
                onBlur={(e) => handleBlur("password", e.target.value)}
              />
            </div>
            <button type="submit" style={styles.button}>Login</button>
            <a href="#" style={styles.forgotPassword}>
              Forgot Password?
            </a>
            <hr />
            <div style={styles.socialButtonsContainer}>
              <a href="#" className="social-button" style={styles.socialButtonImg}>
                <img src="facebook.png" alt="Facebook Login" style={styles.socialButtonImg} />
              </a>
              <a href="#" className="social-button" style={styles.socialButtonImg}>
                <img src="google.png" alt="Google Login" style={styles.socialButtonImg} />
              </a>
            </div>
            <div style={styles.signup}>
              <p style={styles.signupText}>
                New to Cuisining? <a href="/signup" style={styles.signupLink}>Sign Up</a>
              </p>
            </div>
          </form>
        </div>
      </div>
    </div>
  );
};

export default LoginForm;
